import NavBarComp from "../../components/homepage/NavBarComp";
import generateTestKeyPair from "../../api/makeNewKeysAPI.jsx";
import Button from "react-bootstrap/Button";
export default props => {
    const [keyPair,setKeyPair] = useState([])
    const generateNewKeys = () => {
        setKeyPair(generateTestKeyPair());
        console.log(keyPair)
    }
    return (
        <>
        <div className="testdashwrap">

        <NavBarComp />
        <div className="testusercard">

        </div>
        <div className="addresses">

        </div>
        <div className="generateNewKeyPair">
            <Button onClick={generateNewKeys}>make new keys</Button>
            {keyPair}
        </div>

        </div>
        </>
    )
}
